import * as React from "react"
import * as Svg from "../Svg"
import * as Db from "../data/Database"

class DiningCard extends React.Component{

    click = () => {
      this.props.onStar(this.props.dataKey, this.props.dining, !this.props.isLiked);
    }

    render() {
      this.data = Db.dining_details[this.props.dining]
      this.data["title"] = this.props.dining
        return (
            <div className={this.props.isLiked ? "card liked" : "card"}>
                <img className="card-image" src={this.data.image} />
                <div className="card-content">
                    <div className="title-container">
                        <span className="title">{this.data.title}</span>
                        <span className="subtitle"> {this.data.price} </span>
                    </div>
                    <div className="body mt-6">
                        <span> {this.data.description} </span>
                    </div>
                    <div className="bottom-container">
                        <div className="inline-icon mt-32">
                            {Svg.location(this.props.isLiked)}
                            <span> {this.data.location} </span>
                        </div>
                        <div
                            className="star-container"
                            onClick={this.click}
                        >
                            {Svg.star(!this.props.isLiked)}
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default DiningCard
